export const styles = theme => ({
    opened: {
        background: theme.palette.white.main,
        bottom: 0,
        left: 0,
        position: "fixed",
        right: 0,
        transition: "all .3s ease-in-out",
        top: 0,
        zIndex: theme.level.fixed,
    },
    closed: {
        background: theme.palette.white.main,
        bottom: 0,
        left: "100%",
        position: "fixed",
        right: 0,
        transition: "all .3s ease-in-out",
        top: 0,
        zIndex: theme.level.fixed,
    },
    overlay: {
        background: theme.palette.backdrop.main,
        bottom: 0,
        left: 0,
        position: "fixed",
        right: 0,
        top: 0,
    },
    header: {
        borderBottom: `1px solid ${theme.palette.grey[50]}`,
        display: "block",
        padding: theme.spacing(2),
    },
    headerIcon: { cursor: "pointer" },
    gutters: { padding: `0 ${theme.spacing(4)}px` },
    dropdown: { boxShadow: "none !important" },
    dropdownLink: {
        color: theme.palette.text.primary,
        textDecoration: "none",
    },
});
